about:
Anne's 'WHY' is to create space for others so they can show up in the world as their best selves.
Through Yoga to bring movement to the body & reconnect to the breath;
Through Mindfulness to quiet the mind & find more balance to navigate the real world;
Through Community to create meaningful connections & empower each other to grow.

With the foundation of her teaching coming from the Vedic tradition & the path of Hatha Yoga, Anne's strength lies in her ability to make these ancient practices accessible to all & relevant to the world we live in.
An advocate for mental health, rest & movement, she teaches classes, workshops & mindfulness programmes in yoga studios, corporate organisations & education institutions across Switzerland & beyond. Anne is also the founder & owner of Bubble Yoga studios....read more
